pragma solidity ^0.8.13;

contract StudentDetails {
    
    uint public studentCount = 0;
    mapping(uint => Student) public students;
    struct Student {
        uint Id;
        string Name;
        string Regno;
        string Dept;
        string Course;
        string Suspension;
        string Image;
    }
    function addStudent(string memory _Name, string memory _Regno, string memory _Dept, string memory _Course, string memory _Suspension, string memory _Image) public {
        
        // Set parameters as required
        require(bytes(_Name).length > 0);
        require(bytes(_Regno).length > 0);
        require(bytes(_Dept).length > 0);
        require(bytes(_Course).length > 0);
        require(bytes(_Suspension).length > 0);
        require(bytes(_Image).length > 0);
        
        
        // Check if requirements satisfied
        if (bytes(_Name).length > 0 && bytes(_Regno).length > 0 && bytes(_Dept).length > 0 && bytes(_Course).length > 0 && bytes(_Suspension).length > 0 && bytes(_Image).length > 0) {
            studentCount++;
            students[studentCount] = Student(studentCount, _Name, _Regno, _Dept, _Course, _Suspension, _Image);
        }
    }
    function getAllStudents(uint _index) public view returns (string memory, string memory, string memory, string memory, string memory, string memory) {
        return (students[_index].Name, students[_index].Regno, students[_index].Dept, students[_index].Course, students[_index].Suspension, students[_index].Image);
    } 
}
